import React from 'react';
import TextField from '@mui/material/TextField';

function LabelInput({ label, setLabel }) {
  return (
    <label>
      Label
      <TextField
        id="outlined-basic"
        label=""
        variant="outlined"
        value={label}
        onChange={(e) => setLabel(e.target.value)}
        required
        />
    </label>
  );
}

export default LabelInput;
